import logo from './logo.png';
import cart_icon from './cart_icon.png';
import hand_icon from './hand_icon.png';
import arrow_icon from './arrow.png';
import hero_img from './hero_image.png';

export default {
    logo,
    cart_icon,
    hand_icon,
    arrow_icon,
    hero_img
};
